import React, { useState, useEffect } from 'react';
import { Card, CardContent, CardHeader, CardTitle } from './ui/card';
import { BarChart, Bar, XAxis, YAxis, ResponsiveContainer, Tooltip } from 'recharts';
import { Plus, ChevronLeft, ChevronRight } from 'lucide-react';
import { Tabs, TabsContent, TabsList, TabsTrigger } from './ui/tabs';
import BudgetForm from './budget/BudgetForm';
import TransactionForm from './transactions/TransactionForm';
import { transactionsApi, budgetsApi, TransactionData, BudgetData } from '../services/api';
import BudgetCategory from './BudgetCategory';
import TransactionList from './TransactionList';
import MonthPicker from './MonthPicker';

interface Transaction {
  id: number;
  category: string;
  amount: number;
  date: string;
  description: string;  // Added this field
}

interface Budgets {
  monthly: Record<string, number>;
  annual: Record<string, number>;
}

const BudgetTracker: React.FC = () => {
  const [currentMonth, setCurrentMonth] = useState(new Date());
  const [transactions, setTransactions] = useState<Transaction[]>([]);
  const [budgets, setBudgets] = useState<Budgets>({
    monthly: {},
    annual: {}
  });

  const [showBudgetForm, setShowBudgetForm] = useState(false);
  const [showTransactionForm, setShowTransactionForm] = useState(false);
  const [editingTransaction, setEditingTransaction] = useState<Transaction | null>(null);

  useEffect(() => {
    loadData();
  }, []);

  const loadData = async () => {
    try {
      const [transactionsData, budgetsData] = await Promise.all([
        transactionsApi.getAll(),
        budgetsApi.getAll()
      ]);

      setTransactions(transactionsData);

      const formattedBudgets: Budgets = {
        monthly: {},
        annual: {}
      };

      budgetsData.forEach((budget: BudgetData) => {
        if (budget.period === 'monthly' || budget.period === 'annual') {
          formattedBudgets[budget.period][budget.category] = budget.amount;
        }
      });

      setBudgets(formattedBudgets);
    } catch (error) {
      console.error('Failed to load data:', error);
    }
  };

  const handleAddBudget = async (newBudget: { category: string; amount: number; period: 'monthly' | 'annual' }) => {
    try {
      await budgetsApi.create(newBudget);
      loadData(); // Reload all data
      setShowBudgetForm(false);
    } catch (error) {
      console.error('Failed to add budget:', error);
    }
  };

  const handleAddTransaction = async (data: Omit<Transaction, 'id'>) => {
    try {
      await transactionsApi.create(data);
      loadData(); // Reload all data
      setShowTransactionForm(false);
    } catch (error) {
      console.error('Failed to add transaction:', error);
    }
  };

  const handleEditTransaction = async (data: Omit<Transaction, 'id'>) => {
    if (editingTransaction) {
      try {
        await transactionsApi.update(editingTransaction.id, data);
        loadData(); // Reload all data
        setEditingTransaction(null);
        setShowTransactionForm(false);
      } catch (error) {
        console.error('Failed to update transaction:', error);
      }
    }
  };

  const handleDeleteTransaction = async (id: number) => {
    try {
      await transactionsApi.delete(id);
      loadData();
    } catch (error) {
      console.error('Failed to delete transaction:', error);
    }
  };

  const handleEditClick = (transaction: Transaction) => {
    setEditingTransaction(transaction);
    setShowTransactionForm(true);
  };

  const handleTransactionFormClose = () => {
    setShowTransactionForm(false);
    setEditingTransaction(null);
  };

  const getFilteredTransactions = () => {
    return transactions.filter(t => {
      const transactionDate = new Date(t.date);
      return (
        transactionDate.getMonth() === currentMonth.getMonth() &&
        transactionDate.getFullYear() === currentMonth.getFullYear()
      );
    });
  };

  return (
    <div className="max-w-5xl mx-auto p-4 space-y-6">
      <div className="flex justify-between items-center">
        <h1 className="text-2xl font-bold text-gray-900">Budget Tracker</h1>
        <button
          onClick={() => setShowTransactionForm(true)}
          className="flex items-center gap-2 bg-indigo-500 text-white px-4 py-2 rounded-lg hover:bg-indigo-600 transition-colors"
        >
          <Plus size={20} /> Add Transaction
        </button>
      </div>

      <button
        onClick={() => setShowBudgetForm(true)}
        className="flex items-center gap-2 bg-green-500 text-white px-4 py-2 rounded-lg hover:bg-green-600 transition-colors"
      >
        <Plus size={20} /> Add Budget Category
      </button>

      <MonthPicker currentDate={currentMonth} onChange={setCurrentMonth} />

      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        <BudgetCategory
          title="Monthly Budgets"
          budgets={budgets.monthly}
          transactions={getFilteredTransactions()}
        />
        <BudgetCategory
          title="Annual Budgets"
          budgets={budgets.annual}
          transactions={transactions}
        />
      </div>

      <TransactionList
        transactions={getFilteredTransactions()}
        onEdit={handleEditClick}
        onDelete={handleDeleteTransaction}
      />

      {showBudgetForm && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center p-4">
          <div className="max-w-md w-full">
            <BudgetForm onSave={handleAddBudget} />
          </div>
        </div>
      )}

      {showTransactionForm && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center p-4">
          <div className="max-w-md w-full">
            <TransactionForm
              categories={[
                ...Object.keys(budgets.monthly),
                ...Object.keys(budgets.annual)
              ]}
              onSave={editingTransaction ? handleEditTransaction : handleAddTransaction}
              editTransaction={editingTransaction || undefined}
              onCancel={handleTransactionFormClose}
            />
          </div>
        </div>
      )}
    </div>
  );
};

export default BudgetTracker;
